<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Generator landing pages</title>

    <!-- Bootstrap -->
    <link
      href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css"
      rel="stylesheet"
    />

    <!-- Fonts -->
    <link
      href="https://fonts.googleapis.com/css2?family=Orbitron:wght@500;700&family=Share+Tech+Mono&display=swap"
      rel="stylesheet"
    />

    <style>
      :root {
        --gundam-blue: #0033a0;
        --gundam-red: #e60012;
        --gundam-yellow: #ffd600;
        --gundam-white: #f4f4f4;
        --gundam-gray: #1a1a1a;
        --radius: 12px;
        --glow: 0 0 12px rgba(0, 153, 255, 0.8);
      }
      body {
        background: #0a0a0a;
        color: var(--gundam-white);
        font-family: "Orbitron", sans-serif;
        display: flex;
        align-items: center;
        justify-content: center;
        min-height: 100vh;
        overflow: hidden;
      }

      /* Background grid */
      body::before {
        content: "";
        position: fixed;
        inset: 0;
        background: linear-gradient(
            to right,
            rgba(0, 153, 255, 0.15) 1px,
            transparent 1px
          ),
          linear-gradient(
            to bottom,
            rgba(0, 153, 255, 0.15) 1px,
            transparent 1px
          );
        background-size: 40px 40px;
        z-index: -2;
      }

      /* Radar scanner */
      .radar {
        position: fixed;
        width: 400px;
        height: 400px;
        border-radius: 50%;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background: radial-gradient(
          circle,
          rgba(0, 255, 128, 0.12) 0%,
          transparent 70%
        );
        border: 2px solid rgba(0, 255, 128, 0.4);
        overflow: hidden;
        z-index: -1;
      }
      .radar::before {
        content: "";
        position: absolute;
        width: 200%;
        height: 200%;
        top: -50%;
        left: -50%;
        background: conic-gradient(rgba(0, 255, 128, 0.3), transparent 60%);
        animation: spin 5s linear infinite;
      }
      @keyframes spin {
        100% {
          transform: rotate(360deg);
        }
      }

      /* Card HUD */
      .hud-card {
        background: rgba(20, 22, 30, 0.92);
        border: 2px solid var(--gundam-blue);
        border-radius: var(--radius);
        box-shadow: 0 0 25px rgba(0, 153, 255, 0.3);
        padding: 2rem;
        position: relative;
        margin-top: -10rem;
      }
      .hud-card::before {
        content: "";
        position: absolute;
        inset: -6px;
        border: 2px dashed var(--gundam-red);
        border-radius: var(--radius);
        pointer-events: none;
        opacity: 0.6;
      }
      h1 {
        font-size: 1.8rem;
        margin-bottom: 0.5rem;
        color: var(--gundam-yellow);
        text-align: center;
        text-shadow: var(--glow);
      }
      .note {
        font-size: 0.75rem; /* lebih kecil */
        text-align: center;
        border: 1px solid var(--gundam-red);
        padding: 0.2rem 0.4rem; /* tipis */
        border-radius: var(--radius);
        background: rgba(230, 0, 18, 0.1);
        font-family: "Share Tech Mono", monospace;
        margin-bottom: 1rem;
      }

      input,
      textarea {
        background: rgba(255, 255, 255, 0.05) !important;
        border: 1.5px solid var(--gundam-blue) !important;
        color: var(--gundam-white) !important;
        font-family: "Share Tech Mono", monospace;
      }
      input:focus,
      textarea:focus {
        border-color: var(--gundam-red) !important;
        box-shadow: var(--glow) !important;
      }
      textarea {
        min-height: 100px;
      }
      .btn-gundam {
        border-radius: var(--radius);
        font-family: "Orbitron", sans-serif;
        font-weight: 700;
        letter-spacing: 1px;
        transition: 0.2s;
      }
      .btn-generate {
        background: var(--gundam-blue);
        border: 1.5px solid var(--gundam-yellow);
        color: var(--gundam-white);
        text-shadow: 0 0 5px var(--gundam-yellow);
      }
      .btn-generate:hover {
        background: var(--gundam-yellow);
        color: var(--gundam-gray);
      }
      .btn-copy {
        background: var(--gundam-red);
        border: 1.5px solid #ff8080;
        color: #fff;
      }
      .btn-copy:hover {
        background: #ff3333;
      }
      footer {
        text-align: center;
        margin-top: 2rem;
        margin-bottom: -1rem;
        font-size: 0.8rem;
        opacity: 0.7;
        font-family: "Share Tech Mono", monospace;
      }
      marquee {
        color: var(--gundam-yellow);
        font-weight: 600;
        text-shadow: var(--glow);
        font-size: 0.8rem; /* lebih tipis */
        line-height: 1.2; /* rapat */
      }
      /* Atur jarak antar radio option */
      .radio-group {
        display: flex;
        gap: 1.5rem; /* jarak antar pilihan */
        align-items: center;
      }

      .radio-group input[type="radio"] {
        margin-right: 0.3rem; /* jarak kecil antara lingkaran & teks */
      }
    </style>
  </head>
  <body>
    <!-- Radar background -->
    <div class="radar"></div>

    <div class="container">
      <div class="hud-card mx-auto" style="max-width: 460px">
        <h1 class="mb-3">Generator LP</h1>
        <div class="note">
          <marquee class="mt-1">⚡ HOOLIGANS ⚡</marquee>
        </div>

        <div class="mb-3">
          <label for="url" class="form-label">Custom Rdrct *</label>
          <input
            type="text"
            id="customLink"
            class="form-control"
            value=""
            placeholder="e.g. https://google.com/"
            onclick="this.select()"
          />
        </div>

        <div class="mb-3">
          <label for="number" class="form-label">Items *</label>

          <input
            type="number"
            id="items"
            class="form-control"
            value="1"
            min="1"
            max="1000"
            onclick="this.select()"
          />
        </div>
        <!-- radio button -->
        <div class="mb-3">
          <label class="form-label">Select Option:</label>
          <div class="radio-group">
            <div>
              <input
                type="radio"
                id="default"
                name="shorteran"
                value="default"
                checked
              />
              <label for="default">default</label>
            </div>
            <div>
              <input type="radio" id="ix.sk" name="shorteran" value="ix.sk" />
              <label for="ix.sk">ix.sk</label>
            </div>
            <div>
              <input
                type="radio"
                id="bom.so"
                name="shorteran"
                value="bom.so"
                disabled
              />
              <label for="bom.so">bom.so</label>
            </div>
          </div>
        </div>

        <div class="d-flex justify-content-end gap-2">
          <button id="generate" class="btn btn-gundam btn-generate">
            GENERATE
          </button>
          <button class="btn btn-gundam btn-copy" onclick="copyResult()">
            COPY
          </button>
        </div>

        <div class="mt-3">
          <textarea
            id="result"
            class="form-control"
            placeholder="Result will appear here..."
            onclick="this.select()"
            rows="5"
          ></textarea>
        </div>

        <footer>© 2025 - PKMX</footer>
      </div>
    </div>

    <!-- Bootstrap JS -->
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/js/bootstrap.bundle.min.js"></script>
